import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    description: string;
    date: string;
    onDelete:(id: number) => void;
    onSearch:string;
}

const Events: React.FC<Props> = ({events, onDelete, onSearch}) => {

    const error:boolean = false;

    return (
        <>
        <h1>Event list: </h1>
        <ul>
        {events?.map((event, index) => {
            if (onSearch == "" || event.description.toLowerCase().includes(onSearch.toLowerCase())) {
                const error = false;
                return (
                    <Item 
                        key={event.id}
                        id={event.id}
                        description={event.description}
                        date={event.date} 
                        events={[]}
                        onDelete={onDelete}        
                    /> 
                )} else {
                    console.log(error);

                    const error = true;
                }

            })
        } 
        </ul>

        {error && <p>Not found</p>}

    </>
    )}



export default Events
